import { Component } from '@angular/core';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html'
})
export class LoginComponent {
  loginGoogle() {
    window.location.href = 'http://localhost:3000/auth/google';
  }
}
<h2>Login</h2>
<button (click)="loginGoogle()">Login com Google</button>
